VINCULOS.OUTRAS-INFORMACOES:
Cooperação Internacional ? Programa de Capacitação de Docente e Ensino de Língua Portuguesa em Timor Leste, atuando na Universidade Nacional Timor Lorosa? e (UNTL) na coordenação do Programa de Pós-Graduação na Faculdade de Ciências Educação nos cursos de Especialização em Educação e Ensino, Educação Ambiental, Gestão Educacional e Ensino de Língua Portuguesa. Docência nos quatro cursos, Orientações de monografias; Formação de recursos humanos- educação e saúde, professores e gestores da Educação elaboração de materiais didáticos, consultorias, Orientações de monografias, publicações de artigos científicos e livros, realização de seminários, coordenação das atividades de discentes, docentes e projetos.
Docência na disciplina de ELABORAÇÃO DE PROJETO DE PESQUISA E TRABALHO DE CAMPO (30h/a) para os cursos Lato Sensu em Educação e Ensino, Educação Ambiental, Ensino de Língua Portuguesa e Gestão Educacional;
Docência na disciplina Ciência e Tecnologia (30h/a) no curso lato sensu em Educação e Ensino, Docência nas disciplinas Ecologia Geral (30h/a), Bioconservação e Estudos Energéticos (30h/a) no curso lato sensu em Educação Ambiental. Orientações de monografias nos cursos de Educação e Ensino, Educação Ambiental, e Gestão Educacional.
